import React from 'react'

const UserInfo = ( { user } ) => {

    if(user === undefined){
        return null
    }

    return (
        <div>
            <h2>{user.name}</h2>
            <div>added blogs</div>
            <ul>
                {user.blogs.map(blog =>
                    <li key={blog.id}>
                        {blog.title}
                    </li>
                )}
            </ul>
        </div>
    )
}


export default UserInfo
